        console.log(current, pageSize);
    };
    return (
        <Pagination
            showSizeChanger
            onShowSizeChange={onShowSizeChange}
            defaultCurrent={1}
            total={500}
            pageSizeOptions={[10, 30, 50, 100]}
        />
    );

}

